    false,nt"url": null,nt"notes": "Ducks Unlimited Canada and the Natural
    Resources Conservation Service of the United States Department of Agriculture jointly
    released Revegetating With Native Grasses in 1995.  That manual fulfilled a long
    recognized need to summarize the lessons both agencies had learned about successfully
    planting native grasses in the western prairie/plains region of the continent. The
    development of that information had begun with the establishment of the NRCS in
    the dust bowl days of the 1930s. There are some distinct challenges to success with
    native grasses in the east, as well as unique rewards. This handbook attempts to
    capture both.",nt"license_title": "License Not Specified",nt"extras":
